import React from 'react';
import style from './Progress.module.css';

const Progress = () => {
    return(
        <section>
            <div className={style.progressContainer}>
                <h2 className={style.h2}>Progress:</h2>
                <p className={style.p}>2/4</p>
            </div>
        </section>
    )
}

export default Progress;
